// components/About.js
import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  return (
    <section id="about" className="py-28 relative overflow-hidden bg-gradient-to-br from-[#0A0A0A] to-[#111111]">
      <div className="absolute inset-0 luxury-grid opacity-30"></div>
      
      {/* Animated background elements */}
      <div className="absolute top-1/4 -right-20 w-96 h-96 bg-gold-600/5 rounded-full blur-3xl"></div>
      <div className="absolute bottom-1/4 -left-20 w-80 h-80 bg-gold-600/5 rounded-full blur-3xl"></div>
      
      <div className="container mx-auto px-4 relative z-10">
        <motion.div 
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true, margin: "-100px" }}
          className="text-center mb-20"
        >
          <h2 className="text-5xl font-cinzel font-semibold mb-6 text-white">
            About Me
          </h2>
          <div className="ornamental-divider w-64 mx-auto"></div>
        </motion.div>
        
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-16 items-center">
          <motion.div 
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true, margin: "-100px" }}
            className="relative"
          >
            <div className="luxury-glass rounded-2xl p-10 shadow-2xl border border-gold-600/20">
              <div className="text-lg text-gray-300 leading-relaxed space-y-6">
                <p className="font-cinzel text-2xl text-gold-600 mb-6 italic">
                  "Crafting digital excellence with timeless elegance"
                </p>
                <p>
                  I'm a 16-year-old Software Engineering student with a passion for creating 
                  innovative digital solutions. As an INTP personality type, I thrive on 
                  solving complex problems and building systems that make a difference.
                </p>
                <p>
                  My journey in development started at a young age, and I've since mastered 
                  various technologies across web and mobile development. I specialize in 
                  creating responsive, user-friendly applications with clean, efficient code.
                </p>
                <p>
                  When I'm not coding, you can find me exploring new technologies, 
                  contributing to open-source projects, or brainstorming my next big idea.
                </p>
              </div>
            </div>
            
            <div className="absolute -top-6 -left-6 w-32 h-32 rounded-full bg-gold-600/10 blur-2xl"></div>
            <div className="absolute -bottom-6 -right-6 w-40 h-40 rounded-full bg-gold-600/10 blur-2xl"></div>
          </motion.div>
          
          <motion.div 
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            viewport={{ once: true, margin: "-100px" }}
            className="grid grid-cols-2 gap-6"
          >
            {[
              { name: 'HTML/CSS', level: 95, color: 'from-gold-500 to-gold-600' },
              { name: 'JavaScript', level: 90, color: 'from-gold-500 to-gold-600' },
              { name: 'React.js', level: 85, color: 'from-gold-500 to-gold-600' },
              { name: 'Node.js', level: 80, color: 'from-gold-500 to-gold-600' },
              { name: 'Flutter', level: 75, color: 'from-gold-400 to-gold-500' },
              { name: 'Laravel', level: 70, color: 'from-gold-400 to-gold-500' },
              { name: 'ASP.NET', level: 65, color: 'from-gold-400 to-gold-500' },
              { name: 'MongoDB', level: 85, color: 'from-gold-500 to-gold-600' },
            ].map((skill, index) => (
              <motion.div 
                key={index} 
                className="luxury-glass rounded-xl p-5 hover:shadow-gold transition-all duration-500 group border border-gold-600/10 hover:border-gold-600/30"
                whileHover={{ y: -5 }}
                transition={{ duration: 0.3 }}
              >
                <div className="flex justify-between mb-3">
                  <span className="text-gray-300 font-medium group-hover:text-gold-500 transition-colors">{skill.name}</span>
                  <span className="text-gold-600 font-semibold">{skill.level}%</span>
                </div>
                <div className="w-full bg-gray-800/50 rounded-full h-2.5">
                  <motion.div 
                    className={`h-2.5 rounded-full bg-gradient-to-r ${skill.color}`}
                    initial={{ width: 0 }}
                    whileInView={{ width: `${skill.level}%` }}
                    transition={{ duration: 1.5, delay: index * 0.1 }}
                    viewport={{ once: true }}
                  ></motion.div>
                </div>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
